import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button'
import ButtonGroup from '@material-ui/core/ButtonGroup'
import SaveIcon from '@material-ui/icons/Save'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ButtonGroup>
        <Button
        startIcon = {<SaveIcon />} 

        onClick={()=> alert('Hello')} 
        size="large"
        // disabled
        href="#"
        // style={{
        //   fontSize: 18
        // }} 

        variant="contained" 
        color="secondary">
          Hello world
        </Button>
        <Button

        endIcon = {<SaveIcon />}
        onClick={()=> alert('Hello')} 
        size="large"
        href="#"
        variant="contained" 
        color="primary">
          Hello you
        </Button>
        </ButtonGroup>
        <img src={logo} className="App-logo" alt="logo" />

      </header>
    </div>
  );
}

export default App;
